('node', 'body_content', 0, 13, 13, 'und', 0, '<link rel="stylesheet" type="text/css" href="css/demo.css" />\r\n        <link rel="stylesheet" type="text/css" href="css/style_common.css" />\r\n        <!--<link rel="stylesheet" type="text/css" href="css/style10.css" />-->\r\n        <link href=''http://fonts.googleapis.com/css?family=Oswald'' rel=''stylesheet'' type=''text/css'' />\r\n        <link rel="shortcut icon" href="favicon.ico" type="image/x-icon" />\r\n        <script type="text/javascript" src="https://ajax.googleapis.com/ajax/libs/jquery/1.4.4/jquery.min.js"></script>\r\n<script type="text/javascript">\r\n\r\n$(document).ready(function() {\r\n	DrawCaptcha();\r\n  $(''#btnrefresh'').click(function () {\r\n  	DrawCaptcha();\r\n  });\r\n  \r\n  	$(''#submit'').click(function () {\r\n	\r\n		//Get the data from all the fields\r\n		var name = $(''input[name=name]'');\r\n		var email = $(''input[name=email]'');\r\n		var comment = $(''textarea[name=message]'');\r\n		var captcha = $(''input[name=captcha_code]'');\r\n		\r\n			if (name.val()=='''') {alert(''Name field is empty'');return false;}\r\n\r\n			if (comment.val()=='''') {alert(''Message field is empty'');return false;}\r\n				\r\n			if (email.val()=='''') {\r\n					alert(''Email field is empty'');\r\n				return false;\r\n			}\r\n			\r\n			var reg = /^([A-Za-z0-9_\\-\\.])+\\@([A-Za-z0-9_\\-\\.])+\\.([A-Za-z]{2,4})$/;\r\n			var address = email.val();\r\n			\r\n			if(reg.test(address) == false) {\r\n			alert(''Invalid Email Address'');\r\n			return false;\r\n			}\r\n			\r\n			\r\n		if (captcha.val()=='''') {\r\n				alert(''captcha field is empty'');\r\n			return false;\r\n		    } else {\r\n\r\n		var str1 = $(''input[name=txtCaptcha]'');\r\n		var s = str1.val();\r\n		var d = captcha.val();\r\n			if (s != d){\r\n			alert(''invalid captcha'');\r\n			return false;\r\n			}   \r\n		}\r\n\r\n		\r\n		\r\n});\r\n  \r\n	    function DrawCaptcha()\r\n    {\r\n   var chars = "0123456789ABCDEFGHIJKLMNOPQRSTUVWXTZabcdefghik