s="captcha-text">&nbsp;</td>\r\n\r\n                <td align="left">&nbsp;</td>\r\n\r\n              </tr>\r\n\r\n            </table>\r\n\r\n          </form>\r\n    </div>\r\n          \r\n\r\n  \r\n  <!--Con top full end-->\r\n    <div class="br1"></div>\r\n  \r\n  </div>\r\n  <!--CONTENT END-->', '', 'php_code'),
('node', 'body_content', 0, 16, 16, 'und', 0, '<h1 style="font-family: FuturaStdMedium; font-size: 18pt; color: rgb(51, 51, 51); padding-top: 10px; line-height: normal; text-align: justify;"><span style="font-family: Arial, Helvetica, sans-serif; line-height: 15px; font-size: 13px; font-weight: normal;">&nbsp; &nbsp; &nbsp; &nbsp; All editorial content and graphics on this site are protected by U.S. copyright and international treaties and may not be copied without the express permission of the copyright holder, which reserves all rights. Re-use of any of editorial content and/or graphics online for any purpose is strictly prohibited. The materials from this site is not available for commercial, informational or noncommercial uses online or offline unless express written permission is given. Copying or adapting the HTML or any other language created to generate these pages is also strictly prohibited and protected by copyright. Certain content and graphics originating from the federal government are not covered under copyright.</span></h1>', '', 'full_html'),
('node', 'body_content', 0, 17, 17, 'und', 0, '<h2 style="clear: both; font-size: 12.5pt; margin-top: 0.5em; margin-bottom: 0.5em; color: rgb(51, 51, 51); font-family: ca_bnd_webbold; line-height: normal;">Privacy Notice Table of Contents:</h2><ul id="confull-li" style="list-style-image: initial; margin-top: 0px; margin-bottom: 10px; margin-left: 30px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: normal;"><li style="font-size: 12px; line-height: 20px;">Our Commitment To Privacy</li><li style="font-size: 12px; line-height: 20px;">The Information We Collect</li><li style="font-size: 12px; line-height: 20px;">How We Use Information</li><li style="font-size: 12px; line-height: 20px;">Our Commitment To Data Security</li><li style="font-size: 12px; line-height: 20px;">How To Access Or Correct Your Information</li></ul><h2 style="clear: both; font-size: 12.5pt; margin-top: 0.5em; margin-bottom: 0.5em; color: rgb(51, 51, 51); font-family: ca_bnd_webbold; line-height: normal;">Our Commitment To Privacy</h2><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">Your privacy is important to us. To better protect your privacy we provide this notice explaining our online information practices and the choices you can make about the way your information is collected and used. To make this notice easy to find, we make it available on our homepage and at every point where personally identifiable information may be requested.</p><h2 style="clear: both; font-size: 12.5pt; margin-top: 0.5em; margin-bottom: 0.5em; color: rgb(51, 51, 51); font-family: ca_bnd_webbold; line-height: normal;">The Information We Collect:</h2><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">This notice applies to all information collected or submitted on any of our websites. On some pages, you can order products, make requests, and register to receive materials. The types of personal information collected at these pages are:</p><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">Name<br>Address<br>Email address<br>Phone number<br>Credit/Debit Card Information<br>(etc.)</p><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">On some pages, you can submit information about other people. For example, if you order a gift online and want it sent directly to the recipient, you will need to submit the recipient''s address. In this circumstance, the types of personal information collected are:</p><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">Name<br>Address<br>Phone Number<br>(etc.)</p><h2 style="clear: both; font-size: 12.5pt; margin-top: 0.5em; margin-bottom: 0.5em; color: rgb(51, 51, 51); font-family: ca_bnd_webbold; line-height: normal;">The Way We Use Information:</h2><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">We use the information you provide about yourself when placing an order only to complete that order. We do not share this information with outside parties except to the extent necessary to complete that order.</p><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">We use the information you provide about someone else when placing an order only to ship the product and to confirm delivery. We do not share this information with outside parties except to the extent necessary to complete that order.</p><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">We use return email addresses to answer the email we receive. Such addresses are not used for any other purpose and are not shared with outside parties.</p><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">We use non-identifying and aggregate information to better design our website and to share with advertisers. For example, we may tell an advertiser that X number of individuals visited a certain area on our website, or that Y number of men and Z number of women filled out our registration form, but we would not disclose anything that could be used to identify those individuals.</p><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">Finally, we never use or share the personally identifiable information provided to us online in ways unrelated to the ones described above without also providing you an opportunity to opt-out or otherwise prohibit such unrelated uses.</p><h2 style="clear: both; font-size: 12.5pt; margin-top: 0.5em; margin-bottom: 0.5em; color: rgb(51, 51, 51); font-family: ca_bnd_webbold; line-height: normal;">Our Commitment To Data Security</h2><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">To prevent unauthorized access, maintain data accuracy, and ensure the correct use of information, we have put in place appropriate physical, electronic, and managerial procedures to safeguard and secure the information we collect online.</p><h2 style="clear: both; font-size: 12.5pt; margin-top: 0.5em; margin-bottom: 0.5em; color: rgb(51, 51, 51); font-family: ca_bnd_webbold; line-height: normal;">How You Can Access Or Correct Your Information</h2><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">You can correct factual errors in your personally identifiable information by sending us a request that credibly shows error.</p><p style="margin-bottom: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px; margin-top: 0px; padding-bottom: 15px;">To protect your privacy and security, we will also take reasonable steps to verify your identity before granting access or making corrections.</p>', '', 'full_html'),
('node', 'body_content', 0, 18, 18, 'und', 0, '<style type="text/css">\r\na{\r\ncolor: #000000;\r\n}\r\na:hover {\r\n  text-decoration: none;\r\n  color: #0099FF;\r\n}</style>\r\n<ul style="margin-top: 0px; margin-bottom: 0px; margin-left: 30px; font-family: ca_bnd_webbold; font-size: 17px; font-weight: bold; line-height: normal; text-align: justify; text-transform: uppercase;"><li style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 20px;"><a href="./index" style="font-family: ca_bnd_webbold; font-size: 12.5pt; line-height: 30px;">HOME</a></li><li style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 20px;font-family: ca_bnd_webbold; font-size: 12.5pt; line-height: 30px;">VESSELS<ul class="small-sitemap" style="margin-top: 0px; margin-bottom: 0px; margin-left: 30px;"><li><a href="./archipelago-vessels-fastcat1" style="font-family: ca_bnd_webbold; font-size: 11pt;">FASTCAT M1</a></li></ul></li><li style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 20px;"><a href="./archipelago-schedule" style="font-family: ca_bnd_webbold; font-size: 12.5pt; line-height: 30px;">SCHEDULES</a></li><li style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 20px;"><a href="./archipelago-routes" style="font-family: ca_bnd_webbold; font-size: 12.5pt; line-height: 30px;">ROUTES</a></li><li style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 20px;"><a href="./archipelago-passenger-rate" style="font-family: ca_bnd_webbold; font-size: 12.5pt; line-height: 30px;">RATES</a></li><li style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 20px;"><a href="./archipelago-sitemap" style="font-family: ca_bnd_webbold; font-size: 12.5pt; line-height: 30px;">OTHER SERVICES</a><ul class="small-sitemap" style="margin-top: 0px; margin-bottom: 0px; margin-left: 30px;"><li><a href="./archipelago-advertising" style="font-family: ca_bnd_webbold; font-size: 11pt;">ADVERTISING</a></li><li><a href="./archipelago-cargo-consolidation" style="font-family: ca_bnd_webbold; font-size: 11pt;">CARGO CONSOLIDATION</a></li><li><a href="./archipelago-charter" style="font-family: ca_bnd_webbold; font-size: 11pt;">CHARTER</a></li></ul></li><li style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 20px;"><a href="./archipelago-job-opportunities" style="font-family: ca_bnd_webbold; font-size: 12.5pt; line-height: 30px;">JOB&nbsp;OPPORTUNITIES</a></li><li style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 20px;"><a href="./faqs" style="font-family: ca_bnd_webbold; font-size: 12.5pt; line-height: 30px;">FAQ''S</a></li><li style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 20px;"><a href="./archipelago-newsroom" style="font-family: ca_bnd_webbold; font-size: 12.5pt; line-height: 30px;">NEWS&nbsp;ROOM</a></li><li style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 20px;"><a href="./archipelago-gallery" style="font-family: ca_bnd_webbold; font-size: 12.5pt; line-height: 30px;">GALLERY</a></li><li style="font-family: Arial, Helvetica, sans-serif; font-size: 12px; line-height: 20px;"><a href="./archipelago-contact" style="font-family: ca_bnd_webbold; font-size: 12.5pt; line-height: 30px;">CONTACT&nbsp;US</a></li></ul>', '', 'full_html'),
('node', 'body_content', 0, 19, 19, 'und', 0, '<head>\r\n<link href="css/style.css" rel="stylesheet" type="text/css" media="screen" />\r\n<link href="css/inner-css.css" rel="stylesheet" type="text/css" media="screen" />\r\n\r\n <link rel="stylesheet" type="text/css" href="css/demo.css" />\r\n        <link rel="stylesheet" type="text/css" href="css/style_common.css" />\r\n        <!--<link rel="stylesheet" type="text/css" href="css/style10.css" />-->\r\n        <link href=''http://fonts.googleapis.com/css?family=Oswald'' rel=''stylesheet'' type=''text/css'' />\r\n        <link rel="shortcut icon" href="favicon.ico" type="image/x-icon" />\r\n        \r\n        \r\n        <!--google map-->\r\n        <script type="text/javascript" src="http://maps.google.com/maps/api/js?sensor=false"></script>\r\n    <script type="text/javascript">\r\n\r\n      var map;\r\n      function initialize() {\r\n        var mapDiv = document.getElementById(''map-canvas'');\r\n        map = new google.maps.Map(mapDiv, {\r\n          center: new google.maps.LatLng(14.423800, 121.023532),\r\n          zoom: 17,\r\n          mapTypeId: google.maps.MapTypeId.ROADMAP\r\n        });\r\n  \r\n\r\n    var infoWindow = new google.maps.InfoWindow({\r\n          position: new google.maps.LatLng(14.423800, 121.023532),\r\n          content: ''<p style="font-size:14px">Unit 5-B, 5th Flr., Unioil Center Bldg.<br/> Commerce Avenue <br/> Business Park, Alabang, <br/>Muntinlupa City</p>''\r\n        });\r\n\r\n \r\n  \r\n        infoWindow.open(map);\r\n  \r\n   /**\r\n  \r\n  var infoWindow = new google.maps.InfoWindow({\r\n          position: new google.maps.LatLng(14.589419,121.059964),\r\n          content: ''<p style="font-size:13px"><b>Transerve (AUST) Pty Ltd </b><br> Northern Territory 4/66<br> Coonawarra Road Winnellie<br> NT 0820</p>''\r\n        });\r\n   \r\n        infoWindow.open(map);\r\n\r\n  var infoWindow = new google.maps.InfoWindow({\r\n          position: new google.maps.LatLng(14.575277,120.989342),\r\n       content: ''<p style="font-size:13px">COMPASS 13 Luna Orasa Building, Taft Avenue, Malate Manila, Philippines</p>''\r\n        });\r\n  \r\n\r\n \r\n        infoWindow.open(map);\r\n  \r\n \r\n     google.maps.event.addListenerOnce(map, ''tilesloaded'', addMarkers);\r\n   **/\r\n      }\r\n   /**\r\n         function addMarkers() {\r\n  \r\n          var marker = new google.maps.Marker({\r\n            position: new google.maps.LatLng(14.579949,120.97842),\r\n            map: map,\r\n   title: "  (IMOSTI), Inc. 11th floor Room 1104 Victoria Building United Nations Avenue Ermita, Manila 1000 Philippines",\r\n          });\r\n  \r\n            var marker = new google.maps.Marker({\r\n            position: new google.maps.LatLng(14.589419,121.059964),\r\n            map: map,\r\n   title: "GOMMS 1409-1410 14th Floor Robinson-Equitable Tower ADV Avenue cor. Poveda St. Ortigas Center, Pasig City 1605 Philippines",\r\n          });\r\n    \r\n\r\n    \r\n            var marker = new google.maps.Marker({\r\n            position: new google.maps.LatLng(14.575277,120.989342),\r\n            map: map,\r\n   title: "COMPASS 13 Luna Orasa Building, Taft Avenue, Malate Manila, Philippines",\r\n          });\r\n   \r\n      }**/ \r\n     \r\n\r\n      google.maps.event.addDomListener(window, ''load'', initialize);\r\n    </script>\r\n	<script type="text/javascript" src="https://ajax.googleapis.com/ajax/libs/jquery/1.4.4/jquery.min.js"></script>\r\n<script type="text/javascript">\r\n\r\n$(document).ready(function() {\r\n	DrawCaptcha();\r\n  $(''#btnrefresh'').click(function () {\r\n  	DrawCaptcha();\r\n  });\r\n  \r\n  	$(''#submit'').click(function () {\r\n	\r\n		//Get the data from all the fields\r\n		var name = $(''input[name=name]'');\r\n		var email = $(''input[name=email]'');\r\n		var comment = $(''textarea[name=message]'');\r\n		var captcha = $(''input[name=captcha_code]'');\r\n		\r\n			if (name.val()=='''') {alert(''Name field is empty'');return false;}\r\n\r\n			if (comment.val()=='''') {alert(''Message field is empty'');return false;}\r\n				\r\n			if (email.val()=='''') {\r\n					alert(''Email field is empty'');\r\n				return false;\r\n			}\r\n			\r\n			var reg = /^([A-Za-z0-9_\\-\\.])+\\@([A-Za-z0-9_\\-\\.])+\\.([A-Za-z]{2,4})$/;\r\n			var address = email.val();\r\n			\r\n			if(reg.test(address) == false) {\r\n			alert(''Invalid Email Address'');\r\n			return false;\r\n			}\r\n			\r\n			\r\n		if (captcha.val()=='''') {\r\n				alert(''captcha field is empty'');\r\n			return false;\r\n		    } else {\r\n\r\n		var str1 = $(''input[name=txtCaptcha]'');\r\n		var s = str1.val();\r\n		var d = captcha.val();\r\n			if (s != d){\r\n			alert(''invalid captcha'');\r\n			return false;\r\n			}   \r\n		}\r\n\r\n		\r\n		\r\n});\r\n  \r\n	    function DrawCaptcha()\r\n    {\r\n   var chars = "0123456789ABCDEFGHIJKLMNOPQRSTUVWXTZabcdefghiklmnopqrstuvwxyz";\r\n	var string_length = 5;\r\n	var randomstring = '''';\r\n	for (var i=0; i<string_length; i++) {\r\n		var rnum = Math.floor(Math.random() * chars.length);\r\n		randomstring += chars.substring(rnum,rnum+1);\r\n	}\r\n\r\n        var code = randomstring;\r\n        document.getElementById("txtCaptcha").value = code\r\n    }\r\n	\r\n	\r\n	});	\r\n</script>\r\n\r\n      <!--GOOGLE MAP END-->\r\n        \r\n</head>\r\n\r\n<body>\r\n<!--CONTENT START-->\r\n  <div id="content-wrapper">\r\n	<div id="con-top-full">\r\n			<div class="right-contact" style="float:right;  width: 600px; position:absolute; left: 500px;">\r\n			<p>Please feel free to contact us anytime. <br> We would be delighted to hear from you.</p>\r\n				<form enctype=''multipart/form-data'' action=''sendmail.php'' method=''post'' class="td-form">\r\n					<table width="400" border="0" cellpadding="0" cellspacing="0">\r\n						<tr>\r\n							<td height="45" valign="top" colspan="2"><strong>Name:</strong><br />\r\n							<input name="name" type="text" id="name" size="60" /></td>\r\n						</tr>\r\n						<tr>\r\n							<td height="45" valign="top" colspan="2"><strong>Address:</strong><br />\r\n							<input name="address" type="text" id="address" size="60" /></td>\r\n						</tr>\r\n						<tr>\r\n							<td height="45" valign="top" colspan="2"><strong>Email:</strong><br />\r\n							<input name="email" type="text" id="email" size="60" /></td>\r\n						</tr>\r\n						<tr>\r\n							<td height="45" valign="top" colspan="2"><strong>Contact Number: </strong><br />\r\n							<input name="phone" type="text" id="phone" size="60" /></td>\r\n						</tr>\r\n						<tr>\r\n							<td colspan="2"><strong>Message:</strong><br />\r\n								<textarea name="message" id="message" cols="45" rows="5"></textarea>\r\n								<br />\r\n								<br />\r\n							</td>\r\n						</tr>\r\n						<tr valign="bottom">\r\n							<td width="305" class="captcha-text">\r\n								<input type="text" name="txtCaptcha" id="txtCaptcha" style="background-color:#3E3E3E;color:#15A5A6;width:200px; text-align:center; border:none;font-weight:900;font-size:25px; font-family:Modern" disabled /><br />\r\n								<p>Please enter the characters shown above.</p>\r\n								<input type="text" name="captcha_code" id="captcha" size="10" maxlength="6" />\r\n								<a href="#" id="btnrefresh" class="captcha">Reload Image</a>\r\n							</td>\r\n							<td align="left" width="95">\r\n<INPUT type="image" class="myButton" src="./sites/all/themes/impact_theme/images/images/button.png"  onMouseOver="this.src=''./sites/all/themes/impact_theme/images/images/button1.png''" onMouseOut="this.src=''./sites/all/themes/impact_theme/images/images/button.png''" alt="Click Me" id="submit" value="Submit">\r\n							</td>\r\n						</tr>\r\n						<tr valign="bottom">\r\n							<td class="captcha-text">&nbsp;</td>\r\n							<td align="left">&nbsp;</td>\r\n						</tr>\r\n					</table>\r\n				</form>\r\n		</div>\r\n		<div class="left-contact">\r\n			<p>Archipelago Philippine Ferries Corporation\r\n				Unit 5B, 5th Floor,  Unioil Center Bldg., <br>\r\n			        Commerce corner Acacia Avenue\r\n				Madrigal Business Park, Ayala Alabang, <br> Muntinlupa City, 1780\r\n			</p>\r\n			<p>\r\n				<b>Telephone No.: </b>\r\n					+ 632 842 9341 / 42\r\n			</p>\r\n			<p>\r\n				<b>Fax No.: </b>\r\n				+632 807 5670\r\n			</p>\r\n			<p>\r\n				<b>Email: </b>\r\n				<a href="mailto:customercare.apfc@fastcat.com.ph">customercare.apfc@fastcat.com.ph</a>\r\n			</p>\r\n				<div id="map-canvas" style="width: 460px; height: 350px"></div>\r\n		</div>\r\n	</div>\r\n	<br />\r\n		<!--Con top full end-->\r\n	<div class="br1"></div>\r\n</div>\r\n  <!--CONTENT END-->\r\n</body>', '', 'php_code');
