INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 3, 3, 'und', 0, '<div style="width:900px;height:500px;overflow-y:scroll;overflow-x:hidden;word-wrap: break-word"><div id="englobe" style="color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: normal; top: 0px; float: left; position: relative; width: 910px;"><div class="faq"><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;"><b>1. Ticketing/Bookings</b></p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">a.) Where can we purchase tickets?</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">Tickets may be purchased at the booth of FastCat located at the port terminals.</p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">b.) Is ticket reservation necessary?</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">Reservation is not necessary as tickets are available for purchase at the Fast Cat ticket booths.</p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">c.) Do you give discounts on fares?</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">FastCat is pleased to offer the following fare discounts:</p><table class="td-discout" style="margin-bottom: 15px; margin-left: 37px;" width="392"><tbody><tr><td width="225">Infants below 2 years of age</td><td width="155">FREE</td></tr><tr><td width="225"><span style="color: rgb(51, 51, 51); font-size: 13px;">Children from ages 2-11 years old</span></td><td width="155">50% discount</td></tr><tr><td width="225">S<span style="color: rgb(51, 51, 51); font-size: 13px;">tudents and Senior Citizens</span></td><td width="155">20% discount</td></tr></tbody></table><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">* A Valid ID will be required to avail of the discounts.</p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">d.) If the trip was cancelled, are tickets refundable?</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">In an unfortunate case that a trip was cancelled due to unavailability of the vessel, the ticket will not be refunded in cash.<br>However, our port personnel shall assist you to be transferred to another vessel for your convenience.</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">In cases where trips are cancelled due to non-conducive weather conditions, tickets will be applied on the next available trip after the ban<br>to sail is lifted by the Philippine Coast Guard authorities.</p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">e.) Do you have a facility for online bookings?</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">Unfortunately as of now we do not have an online facility for both passenger and cargo bookings.<br>However you may send inquiries at:</p><p class="txt-p" style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; margin-left: 40px; padding-bottom: 15px;">Archipelago Philippine Ferries Corp.<br>Unit 5B, 5th Floor, Unioil Center Bldg.,&nbsp;<br>Commerce Ave Cor. Acacia Ave.,&nbsp;<br>Madrigal Business Park,&nbsp;<br>Alabang, Muntinlupa City.&nbsp;<br>Tel. No. (632) 842 – 9341 to 42<br>Fax No. (632) 807-5670<br><a href="mailto:inquiry.apfc@fastcat.com.ph" style="color: rgb(4, 29, 86);">Email address: inquiry.apfc@fastcat.com.ph</a></p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">f.) What documents do I need to present if I will board my vehicle on the vessel?</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">One must present the following documents to the port authorities:</p><p class="txt-p" style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; margin-left: 40px; padding-bottom: 15px;">1. Original Official Receipt of the vehicle<br>2. Original Certificate of Registration of the vehicle<br>3. Two Valid ID’s<br><span class="txt-p-no" style="margin-left: 15px;">a. Driver’s License</span><br><span class="txt-p-no" style="margin-left: 15px;">b. A valid ID with photo</span></p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;"><b>2. Restrictions/ Prohibitions:</b></p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">a.) What items are not allowed inside the vessel?</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">For the security and safety of the sea faring public, the following are prohibited inside the vessel:</p><ul style="list-style-type: circle; list-style-image: initial;"><li style="font-size: 12px; margin-left: 15px; line-height: 20px;">Free roaming / uncaged animals</li><li style="font-size: 12px; margin-left: 15px; line-height: 20px;">Any deadly weapon or firearm</li><li style="font-size: 12px; margin-left: 15px; line-height: 20px;">Explosive devices / chemicals</li><li style="font-size: 12px; margin-left: 15px; line-height: 20px;">Corrosive substances</li><li style="font-size: 12px; margin-left: 15px; line-height: 20px;">Hand carried flammable substances</li></ul><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">b.) Is there a smoking area?</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">We regret to inform you that within the air-conditioned area of the Business Class and Premium Economy, smoking is strictly prohibited.<br>However, there is a designated smoking area at the Sundeck/ Economy section.</p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;"><b>3. OTHERS</b></p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">a.) Is food available for sale at the vessel?</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">Yes, food may be purchased at our on-board cafetería.</p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">b.) How early shall I be for my trip?</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">Passengers are expected to have bought their tickets<br>at least an hour before the trip schedule and should be at the boarding area at least 30 minutes before departure time.</p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">c.) We would like to advertise through your vessels, how much will they cost and who do we contact?</p><p class="txt-p" style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; margin-left: 40px; padding-bottom: 15px;">Please contact our Marketing Department for your advertising needs:</p><p class="txt-p" style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; margin-left: 40px; padding-bottom: 15px;"><b>Marketing Department</b><br>842-9342 Loc. 37<br>0917-855-7529<br><a href="mailto:marketing.apfc@fastcat.com.ph" style="color: rgb(4, 29, 86);">marketing.apfc@fastcat.com.ph</a></p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">d.) How do we go about offering food products to be sold at your vessels?</p><p class="txt-p" style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; margin-left: 40px; padding-bottom: 15px;">For inquiries please contact:<br><br><strong>Human Resources Department<br>Tel. No 842-9342 Loc. 24</strong><br><a href="mailto:hr.admin.apfc@fastcat.com.ph" style="color: rgb(4, 29, 86);">hr.admin.apfc@fastcat.com.ph</a></p><p style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px;">e.) What is the maximum weight for a hand-carry luggage?</p><p class="dec-li" style="line-height: 15px; margin-top: 0px; margin-bottom: 15px; margin-left: 25px; padding-left: 15px; background-image: url(http://localhost/fastcat.com.ph1/images/faq-txt.jpg); background-position: 0% 50%; background-repeat: no-repeat no-repeat;">The maximum weight allowed for a hand-carry luggage per person is 15 Kilograms. Any excess to that shall be left at your vehicle.<br>Otherwise, you may ask for assistance from our area representatives for proper storage instructions</p></div></div><p><!--CONTENT START--></p><div id="content-wrapper"><h1>&nbsp;</h1></div><!--CONTENT END--></div><p>&nbsp;</p>', '', 'full_html'),
('node', 'body_content', 0, 5, 5, 'und', 0, '<!--CONTENT START-->\r\n<div id="content-wrapper">\r\n        <div class="right-serv-ad" style="float:right;  position:absolute; right: 1px;">\r\n		<img alt="" src="./sites/all/themes/impact_theme/images/images/archipelago-job1.jpg" style="border-style: none; float: right;">\r\n	</div>\r\n	<span style="font-size: 14px; font-weight: bold; line-height: 1.538em;">Our Company is looking for candidates for the following positions:</span>\r\n	<div id="con-top-full">\r\n		<div class="con-right">\r\n		<h3>\r\n			<span style="font-size:14px;">THREE (3) VESSEL INSPECTORS – (1-Batangas, 1-Calapan, 1-Lipata)</span>\r\n		</h3>\r\n			<p class="text-bold">QUALIFICATIONS:</p>\r\n			<ul>\r\n				<li>Female / Male</li><li>At least twenty-one (21) years of age</li>\r\n				<li>A college graduate of any four (4) - year bachelors’ degree</li>\r\n				<li>Preferably with one (1) year work experience</li>\r\n			</ul>\r\n		<h3>\r\n			<span style="font-size:14px;">ONE (1) LIASON OFFICER / OFFICE STAFF – (HEAD OFFICE— ALABANG MUNTINLUPA CITY)</span>\r\n		</h3>\r\n			<p class="text-bold">QUALIFICATIONS:</p>\r\n   <div class="right-serv-ad" style="float:right;  position:absolute; right: 1px;">\r\n		<img alt="" src="./sites/all/themes/impact_theme/images/images/archipelago-job2.jpg" style="border-style: none; float: right;">\r\n	</div>\r\n			\r\n			<ul>\r\n				<li>Preferably Male</li>\r\n				<li>At least twenty-one (21) years of age</li>\r\n				<li>A college graduate of any four (4) - year bachelor’s degree</li>\r\n				<li>Preferably with relevant work experience</li>\r\n			</ul>\r\n		<h3>\r\n			<span style="font-size:14px;">ONE (1) ACCOUNTING ASSISTANT – (To be assigned at CLARK, PAMPANGA)</span>\r\n		</h3>\r\n			<p class="text-bold">QUALIFICATIONS:</p>\r\n			<ul>\r\n				<li>Female</li>\r\n				<li>At least Twenty-One (21) years of age</li>\r\n				<li>Must be a Certified Public Accountant (CPA)</li>\r\n				<li>At least 1-2 years of work experience in an accounting function<ul></ul></li>\r\n			</ul>\r\n		<h3>\r\n			<span style="font-size:14px;">THREE (3) TELLERS/PURSERS, (To be assigned in Batangas and in Calapan, Mindoro)</span>\r\n		</h3>\r\n		   <div class="right-serv-ad" style="float:right;  position:absolute; right: 1px;">\r\n		<img alt="" src="./sites/all/themes/impact_theme/images/images/archipelago-job3.jpg" style="border-style: none; float: right;">\r\n	</div>\r\n	</div>\r\n	<div>\r\n		<p class="text-bold">QUALIFICATIONS:</p>\r\n		<ul>\r\n			<li>Female/Male</li>\r\n			<li>At least Twenty-One (21) years of age</li>\r\n			<li>Must be a college graduate of any four (4) - year bachelor’s degree</li>\r\n			<li>Preferably with one (1) year work experience within the field of Finance/Accounting</li>\r\n		</ul>\r\n		<h3>\r\n			<span style="font-size:14px;">(1) CASHIER (Calapan, Mindoro)</span>\r\n		</h3>\r\n		<p class="text-bold">QUALIFICATIONS:</p>\r\n			<ul>\r\n				<li>Female/Male</li>\r\n				<li>At least Twenty-One (21) years of age</li>\r\n				<li>Must be a college graduate of any four (4) - year bachelor’s degree</li>\r\n				<li>Preferably with one (1) year work experience within the field of Finance/Accounting</li>\r\n			</ul>\r\n		<h3>\r\n			<span style="font-size:14px;">(1) TERMINAL ASSISTANT / SECRETARY (HEAD OFFICE – ALABANG MUNTINLUPA CITY)</span>\r\n		</h3>\r\n		<div><ul></ul></div>\r\n		<p class="text-bold">QUALIFICATIONS:</p>\r\n			<ul>\r\n				<li>Preferably Female</li>\r\n				<li>At least Twenty-One (21) years of age</li>\r\n				<li>Must be a college graduate of any four (4) - year bachelor’s degree</li>\r\n				<li>Preferably with clerical and administrative experience in an office environment</li>\r\n			</ul>\r\n		<h3>\r\n			<span style="font-size:14px;">USHER/USHERETTE/CANTEEN STEWARD – (Batangas and Calapan Mindoro)</span>\r\n		</h3>\r\n		<p class="text-bold">QUALIFICATIONS:</p>\r\n			<ul>\r\n				<li>Male with a minimum of 5’5 in height; Female with a minimum of 5’3 in height</li>\r\n				<li>At least Twenty-One (21) years of age</li>\r\n				<li>Must be a college graduate of any four (4) - year bachelor’s degree, preferably in Hotel &amp; Restaurant &nbsp;Management, or a course that promotes Tourism/customer service excellence</li>\r\n				<li>Fresh graduates are also welcome to apply</li>\r\n			</ul>\r\n		<h3>\r\n			<span style="font-size:14px;">(2)FINANCE MANAGERS – (ARCHIPELAGO &amp; CAPP GROUP —ALABANG MUNTINLUPA CITY)</span>\r\n		</h3>\r\n		<p class="text-bold">QUALIFICATIONS:</p>\r\n			<div>&nbsp;</div>\r\n			<ul>\r\n				<li>Male /Female</li>\r\n				<li>With a mature outlook</li>\r\n				<li>Must possess a degree in Bachelor of Science in Accountancy</li>\r\n				<li>Preferably with a post-graduate degree in Accountancy, and is a Certified Public Accountant (CPA)</li>\r\n				<li>At least 5 years of work experience is required.</li>\r\n			</ul>\r\n		</div>\r\n		<div class="con-left"></div>\r\n	</div><!--Con top full end--><div class="br1">&nbsp;</div></div><!--CONTENT END-->', '', 'php_code'),
('node', 'body_content', 0, 6, 6, 'und', 0, ' <!--GALLERY JQUERY-->\r\n<script type="text/javascript" src="http://ajax.googleapis.com/ajax/libs/jquery/1.4/jquery.min.js"></script>\r\n	<script>\r\n		!window.jQuery && document.write(''<script src="jquery-1.4.3.min.js"><\\/script>'');\r\n	</script>\r\n	<script type="text/javascript" src="fancybox/jquery.mousewheel-3.0.4.pack.js"></script>\r\n	<script type="text/javascript" src="fancybox/jquery.fancybox-1.3.4.pack.js"></script>\r\n	<link rel="stylesheet" type="text/css" href="fancybox/jquery.fancybox-1.3.4.css" media="screen" />\r\n	<script type="text/javascript">\r\n	 var $j = jQuery.noConflict();\r\n		$j(document).ready(function() {\r\n			/*\r\n			*   Examples - images\r\n			*/\r\n\r\n			$j("a#example1").fancybox();\r\n\r\n			$j("a#example2").fancybox({\r\n				''overlayShow''	: false,\r\n				''transitionIn''	: ''elastic'',\r\n				''transitionOut''	: ''elastic''\r\n			});\r\n\r\n			$j("a#example3").fancybox({\r\n				''transitionIn''	: ''none'',\r\n				''transitionOut''	: ''none''	\r\n			});\r\n\r\n			$j("a#example4").fancybox({\r\n				''opacity''		: true,\r\n				''overlayShow''	: false,\r\n				''transitionIn''	: ''elastic'',\r\n				''transitionOut''	: ''none''\r\n			});\r\n\r\n			$j("a#example5").fancybox();\r\n\r\n			$j("a#example6").fancybox({\r\n				''titlePosition''		: ''outside'',\r\n				''overlayColor''		: ''#000'',\r\n				''overlayOpacity''	: 0.9\r\n			});\r\n\r\n			$j("a#example7").fancybox({\r\n				''titlePosition''	: ''inside''\r\n			});\r\n\r\n			$j("a#example8").fancybox({\r\n				''titlePosition''	: ''over''\r\n			});\r\n\r\n			$j("a[rel=example_group]").fancybox({\r\n				''transitionIn''		: ''none'',\r\n				''transitionOut''		: ''none'',\r\n				''titlePosition'' 	: ''over'',\r\n				''titleFormat''		: function(title, currentArray, currentIndex, currentOpts) {\r\n					return ''<span id="fancybox-title-over">Image '' + (currentIndex + 1) + '' / '' + currentArray.length + (title.length ? '' &nbsp; '' + title : '''') + ''</span>'';\r\n				}\r\n			});\r\n\r\n			/*\r\n			*   Examples - various\r\n			*/\r\n\r\n			$j("#various1").fancybox({\r\n				''titlePosition''		: ''inside'',\r\n				''transitionIn''		: ''none'',\r\n				''transitionOut''		: ''none''\r\n			});\r\n\r\n			$j("#various2").fancybox();\r\n\r\n			$j("#various3").fancybox({\r\n				''width''				: ''75%'',\r\n				''height''			: ''75%'',\r\n				''autoScale''			: false,\r\n				''transitionIn''		: ''none'',\r\n				''transitionOut''		: ''none'',\r\n				''type''				: ''iframe''\r\n			});\r\n\r\n			$j("#various4").fancybox({\r\n				''padding''			: 0,\r\n				''autoScale''			: false,\r\n				''transitionIn''		: ''none'',\r\n				''transitionOut''		: ''none''\r\n			});\r\n		});\r\n	</script><!--GALLERY JQUERY END-->\r\n\r\n<script type="text/javascript" src="http://ajax.googleapis.com/ajax/libs/jquery/1.6.4/jquery.min.js"></script>\r\n<script type="text/javascript" src="js/scroll/jquery-1.4.2.min.js"></script>\r\n		<script type="text/javascript" src="js/scroll/ui.core-1.7.2.js"></script>\r\n		<script type="text/javascript" src="js/scroll/ui.draggable-1.7.2.js"></script>\r\n		<script type="text/javascript" src="js/scroll/jquery.mousewheel.min.js"></script>\r\n		<script type="text/javascript" src="js/scroll/plugin.scrollbar.js"></script>\r\n		<script type="text/javascript">\r\n			$(document).ready(function(){\r\n				$("#contenu").scrollbar();\r\n			});\r\n		</script>\r\n\r\n<div id="column-table" style="overflow: hidden; margin-right: auto; margin-left: auto; width: 930px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: normal;"><h2 style="font-family: ca_bnd_webbold; font-size: 12.5pt;">SECTIONS OF THE VESSEL</h2><div class="col-ves-1" style="float: left; width: 280px; height: 285px; margin-bottom: 15px;"><p style="text-align: center;"><img alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-part-cardeck.jpg" style="border-style: none;"></p><p style="text-align: center;"><strong style="line-height: 15px;">CARDECK&nbsp;</strong><span style="line-height: 15px;">- Can hold up to 30-34 cars, and 6-7 trucks / buses.</span></p></div><div class="col-ves-2" style="float: left; width: 280px; height: 285px;  margin-bottom: 15px; padding-right: 15px; padding-left: 15px;"><p style="text-align: center;"><img alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-part-roro.jpg" style="border-style: none;"></p><p style="text-align: center;"><strong style="line-height: 15px;">ROLL ON ROLL OFF RAMP &amp; SAFETY LIFE RAFTS IN CASE OF EMERGENCY</strong></p></div><div class="col-ves-3" style="float: left; width: 280px; margin-bottom: 15px;"><p style="text-align: center;"><img alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-part-elevator.jpg" style="border-style: none;"></p><p style="text-align: center;"><strong style="line-height: 15px;">ELEVATOR FOR PEOPLE WITH DISABILITIES</strong></p></div><div class="col-ves-1" style="float: left; width: 280px; margin-bottom: 15px; padding-left: 0px; "><p style="text-align: center;"><img alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-business.jpg" style="border-style: none;"></p><div><p class="txt-vess" style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-top: 10px; text-align: center;"><strong>BUSINESS CLASS&nbsp;</strong>- Fully air conditioned, with an LCD TV and can accommodate up to 63 passengers. All with individual life vests.</p></div></div><div class="col-ves-2" style="float: left; width: 280px; height: 285px;  margin-bottom: 15px; padding-right: 15px; padding-left: 15px;"><p style="text-align: center;"><img alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-part-premium.jpg" style="border-style: none;"></p><div><p class="txt-vess" style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-top: 10px; text-align: center;"><strong>PREMIUM ECONOMY</strong>&nbsp;- Fully air conditioned, with 2 LCD TV''s and can accommodate up to 107 passengers. All with individual life vests.</p></div></div><div class="col-ves-3" style="float: left; width: 280px; margin-bottom: 15px;"><p style="text-align: center;"><img alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-part-sundeck.jpg" style="border-style: none;"></p><div><p class="txt-vess" style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-top: 10px; text-align: center;"><strong>SUNDECK/ECONOMY</strong>&nbsp;- Open area, and can accommodate up to 105 passengers. All with individual life vests.<br>&nbsp;</p></div></div><div class="col-ves-1" style="float: left; width: 280px; margin-bottom: 15px;"><p style="text-align: center;"><img alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-part-cafeteria.jpg" style="border-style: none;"></p><div><p class="txt-vess" style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-top: 10px; text-align: center;"><strong>CAFETERIA</strong>&nbsp;- With a wide selection of food and beverages.</p></div></div><div class="col-ves-2" style="float: left; width: 280px; height: 285px; margin-bottom: 15px; padding-right: 15px; padding-left: 15px;"><img alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-engine-room.jpg" style="border-style: none;"><p></p><div><p class="txt-vess" style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-top: 10px; text-align: center;"><strong>ENGINE ROOM&nbsp;</strong>- Equipped with superior engines that are fully compliant with international maritime standards.</p></div></div><div class="col-ves-3" style="float: left; width: 280px; margin-bottom: 15px;"><p style="text-align: center;"><img alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-the-bridge.jpg" style="border-style: none;"></p><div><p class="txt-vess" style="line-height: 15px; margin-top: 0px; margin-bottom: 0px; padding-top: 10px; text-align: center;"><strong>THE BRIDGE&nbsp;</strong>- With state-of-the-art navigation and control system.</p></div></div><h2 style="font-family: ca_bnd_webbold; font-size: 12.5pt; color: rgb(51, 51, 51); line-height: normal;">&nbsp;</h2></div><p>\r\n\r\n<!--CONTENT START-->\r\n <div style="width:900px;height:500px;overflow-y:scroll;overflow-x:hidden;word-wrap: break-word"><div id="content-wrapper"> <div id="con-top-full">\r\n<!--VESSEL FEATURES START--></p><h2>UNIQUE AND SAFETY FEATURES OF FASTCAT</h2>\r\n<div id="contenu">\r\n<div id="div-full"><div id="unique-div"><img align="left" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-sea-transport.png"><p class="txt-padding"><br>FastCat was designed by Sea Transport Solution of Australia, the leading designer of mid-speed catamaran vessels in the world and operates in more than 30 countries. FastCat was specifically designed to suit the weather and sea conditions in the Philippines.</p></div><div id="unique-div"><img align="right" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-american.png"><p class="txt-padding-right"><br>FastCat is certified and classed by the American Bureau of Shipping (ABS), indicating its compliance with the latest international safety rules and regulations, that is why FastCat is SAFER than other RORO vessels.</p></div><div id="unique-div"><img align="left" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-twin-hulls.png"><p class="txt-padding"><br>A typical RORO being used in the Philippines has only one hull. FastCat, on the other hand, is a CATAMARAN with two hulls and 10 water tight compartments. FastCat''s twin-hull design makes her more stable because the center of buoyancy and gravity is wider than a monohull.</p></div><div id="unique-div"><img align="right" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-ballast-tank.png"><p class="txt-padding-right"><br><br>FastCat keeps the water out of the vessel, that’s why it doesn’t have a ballast tank unlike the other RORO vessels. This makes it safer, lighter and faster than the rest.</p></div><div id="unique-div"><img align="left" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-vehicles-pas.png"><br><br><img align="left" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-vehicles-car.png"><p class="txt-padding">FastCat can accommodate 275 up to 320 passengers, including the disabled and the elderly, and has a capacity of approximately 300 lane meters for trucks/buses (6-7 units), cars (30-34 units), and other land vehicles.</p></div><!--COPY--><div id="unique-div"><img align="right" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-ave-yanmar-a.png"><br><br><img align="right" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-ave-yanmar-b.png"><p class="txt-padding-right">It runs at an average speed of 16.5 knots, therefore is faster than most RORO vessels in the Philippines. It is due to the vessels design and because it is powered by four internationally-classed and ABS-certified Yanmar engines, while most RORO vessels only have one.</p></div><div id="unique-div"><img align="left" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-ferry-envi.png"><p class="txt-padding"><br>FastCat is the first and only pro-environment ferry engine in the Philippines, having passed the TIER 2 emission standards in sulphur and carbon dioxide. In short, it performs better than most RORO engines and emits less pollution.</p><p>&nbsp;</p></div><!--copy2--><div id="unique-div"><img align="right" alt="" height="94" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-four-engine.png" width="94"><p class="txt-padding-right"><br>In case of an emergency, a single engine mono hull RORO vessel has to stop the voyage and may not be able to return to the port. On the other hand, FastCat has four engines and a twin hull, therefore it is better equipped to handle engine emergencies than most RORO vessels. FastCat is also the only ferry compliant to the International Maritime Organization’s safe return to port regulation.</p></div><div id="unique-div"><img align="left" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-3m.png"><br><p class="txt-padding">FastCat has a clearance between the water and the hull of three meters. It is three times higher than most RORO vessels, which are categorized and designed to operate ONLY on inland or smooth water. Therefore if a one-meter wave hits the vessel, water will NOT get inside the car deck or the hull, mitigating the risk of a major maritime incident.</p></div><!--copy3--><div id="unique-div"><img align="right" alt="" height="94" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-our-point.png" width="94"><p class="txt-padding-right"><br>FastCat is also compliant with international fire safety standards. Its passenger accommodation area and engine room are insulated with the highest and internationally-certified A60 fire protection system. FastCat is also equipped with a COMPLETE fire alarm system including the latest FM 200 inside the engine rooms. This will ensure the safety of the crew in case of an emergency.</p></div><div id="unique-div"><img align="left" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-e-leather.png"><br><p class="txt-padding">For the passenger seats, FastCat uses E-leather, a fire-retardant, durable and environment-friendly material that is imported from the United Kingdom. This material is unique because it takes a longer time to combust compared to regular leather or other upholstery materials.</p></div><!--copy4--><div id="unique-div"><img align="right" alt="" height="94" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-state-of-art.png" width="94"><p class="txt-padding-right"><br>FastCat uses a state-of-the-art navigation and control system. It has two steering control systems and in case of failure, it can shift from automatic to manual steering inside the engine room and take the passengers safely to shore.</p></div><div id="unique-div"><img align="left" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-solar-wind.png"><br><p class="txt-padding">The vessel has two auxiliary engines that provide electricity. But what makes FastCat superior is her bridge control system. It is primarily powered by solar panels and wind turbines which makes her<br>pro-environment. All these state-of-the-art features simply mean that FastCat has a 100 percent redundancy on performance and safety, therefore minimizing the risk of maritime incidents.</p></div><!--copy5--><div id="unique-div"><img align="right" alt="" height="94" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-cr.png" width="94"><p class="txt-padding-right"><br><br>Also, it comes with clean comfort rooms for both men and women as well as the disabled.</p></div><div id="unique-div"><img align="left" alt="" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-45-year.png"><br><br><p class="txt-padding">FastCat’s design incorporates international, environmental and safety standards and she is rated to function and perform for 45 years.</p></div><div id="unique-div"><img align="right" alt="" height="94" src="./sites/all/themes/impact_theme/images/images/vessels/archipelago-vessel-feat-up-to-date.png" width="94"><p class="txt-padding-right"><br><br>FastCat is one of the safest and state-of-the-art RORO vessel, but more importantly, its crew are competent and ready to be of service to the riding public. They undergo regular trainings to keep abreast with the latest technology, information and international best practices to ensure the safety of its passengers in all possible scenarios and increase the level of competency and quality of service.</p></div></div></div><br><!--Con top full end--><div class="br1">&nbsp;</div><!--CONTENT END--><p>&nbsp;</p>\r\n</div>\r\n</div></div>\r\n ', '', 'php_code'),
('node', 'body_content', 0, 7, 7, 'und', 0, '<p><img alt="Description: http://localhost/fastcat.com.ph/images/archipelago-about-1.jpg" src="\\drupal\\sites\\all\\themes\\impact_theme\\images\\archipelago-about-1.jpg" style="float: left; width: 281px; height: 199px;">Archipelago Philippine Ferries Corporation (APFC) was founded to provide a vital maritime link between the Philippines'' 7,107 islands. Since its incorporation in 2002, it has become a trusted shipping company that owns and operates the Philippines'' first and only catamaran Roll-on/Roll-off (RoRo) ferries, as well as modernized ports and terminals in the eastern and western Philippine sea route. In support of the government''s Strong Republic Nautical Highway Project, and to facilitate the economical movement of people and goods, APFC offers safe, fast and convenient ferry service to the islands using state-of-the-art RoRo vessels. These new vessels are the first ferries designed specifically for Philippine water conditions.</p><p><img alt="Description: http://localhost/fastcat.com.ph/images/archipelago-about-2.jpg" src="\\drupal\\sites\\all\\themes\\impact_theme\\images\\archipelago-about-2.jpg" style="float: right; width: 197px; height: 132px;">With its focus on ensuring its passengers'' safety, welfare and comfort, APFC embarked on an ambitious re-fleeting program in 2010. In a bold and unparalleled move, it partnered with Sea Transport Solutions of Australia, the leading designer and builder of mid-speed Ropax/RoRo vessels built for freight vehicle transport along with passenger accommodations. This partnership brings to the Philippines, for the first time ever, 10 brand-new, custom-crafted, cutting-edge Ropax vessels fitted with world-class amenities and fully compliant with international standards for lifesaving, fire fighting, and damage-stability.</p><p><img alt="Description: http://localhost/fastcat.com.ph/images/archipelago-about-3.jpg" src="\\drupal\\sites\\all\\themes\\impact_theme\\images\\archipelago-about-3.jpg" style="float: left; width: 197px; height: 132px;">This new-ferry initiative is in keeping with Chairman, Christopher Pastrana''s resolve to raise the bar in maritime safety in the Philippines and set an example to fellow Ropax operators, improving not only the ferry industry in general, but also enhancing the comfort and convenience of passengers and ensuring their safety, in particular.</p><p><img alt="Description: http://localhost/fastcat.com.ph/images/archipelago-about-4.jpg" src="\\drupal\\sites\\all\\themes\\impact_theme\\images\\archipelago-about-4.jpg" style="float: right; width: 199px; height: 134px;">The first routes to be served by the new ferries include the town/city pairs of Batangas City, Batangas and Calapan, Oriental Mindoro; Roxas, Oriental Mindoro and Caticlan, Aklan; Matnog, Sorsogon and Allen, Northern Samar; Bacolod City, Negros Occidental and Iloilo City, Iloilo; Lilioan, Southern Leyte and Lipata, Surigao del Norte; and Dipolog City, Zamboanga del Norte and Dumaguete, Negros Oriental. Passengers in these routes will experience the safest and fastest sea connections between their chosen town/city pairs. In addition, they will be treated to a wide selection of on-board food and beverages, on-board entertainment, and comfortable passenger accommodation.</p><p>Terminal facilities managed by APFC include those in the ports of Matnog, Sorsogon; Dapdap, Allen, Northern Samar; San Isidro, Northern Samar; Liloan, Southern Leyte and Lipata, Surigao del Norte;</p><p><img alt="Description: http://localhost/fastcat.com.ph/images/archipelago-about-5.jpg" src="\\drupal\\sites\\all\\themes\\impact_theme\\images\\archipelago-about-5.jpg" style="float: left; width: 281px; height: 199px;">APFC takes pride in having built strong and lasting ties, not only with its partner suppliers and contractors, but most importantly, with its customers and employees.</p><p>Only with their trust, help and support has Archipelago Philippine Ferries Corporation been able to achieve its status as a trusted provider of consistent and quality service. It is APFC''s aim to always be deserving of this trust.</p><p>Archipelago Philippine Ferries Corporation.<br>FerrySafe. FerryFast. FerryConvenient.</p><p style="text-align: center;height:0px;"><img alt="" src="\\fastcat.com.ph\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-br-line.jpg" style="border-style: none; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: normal;"></p><div id="column-bottom" style="overflow: hidden; font-family: Arial, Helvetica, sans-serif; width:99%"><div class="column1" style="float: left; width: 30%;padding:10px"><h1 style="font-family: FuturaStdMedium; text-align: justify;">MISSION</h1><div class="p" style="text-align: justify;">Our mission is to make a positive contribution to the economic vitality of the Philippines by providing a safe, reliable, and comfortable ferry transportation system compliant with international standards.</div></div><div class="column2" style="float: left; width: 30%;padding:10px"><h1 style="font-family: FuturaStdMedium; text-align: justify;">VISION</h1><div class="p" style="text-align: justify;">Our vision is to set the standard in ferry transportation by providing exceptional performance and customer service.</div></div><div class="column3" style="float: left; width: 30%;padding:10px"><h1 style="font-family: FuturaStdMedium; text-align: justify;">CORE VALUES</h1><div class="p" style="text-align: justify;">Archipelago Philippine Ferries Corporation is guided at all times by its core values of TEAMWORK, INTEGRITY, COMMITMENT and CUSTOMER FOCUS.</div><div style="text-align: center;">&nbsp;</div></div></div>', '', 'full_html'),
