('node', 'body_content', 0, 11, 11, 'und', 0, '<style>\r\n table{\r\n   border-collapse: separate;\r\n  border:none;\r\n }\r\n tr,td,th{\r\n  border:none;\r\n }\r\n img{\r\n  border:none;\r\n }\r\n</style>\r\n<p><strong>Note</strong>:Click the image to enlarge.</p>\r\n<div style="width:910px;height:500px;overflow-y:hidden;overflow-x:hidden;word-wrap: break-word">\r\n  <table style="width:100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:466px;" valign="top">\r\n				<p align="center">\r\n					<a href=".\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-rate-passenger-bignew.jpg" rel="lightbox" title="Rates per passenger">\r\n						<img alt=".\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-rate-passenger-smallnew.jpg" src=".\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-rate-passenger-bignew.jpg" style="border-width: 0px; border-style: solid; width: 449px; height: 391px;"> \r\n					</a>\r\n				</p>\r\n			</td>\r\n			<td style="width:466px;" valign="top">\r\n				<p align="center">\r\n					<a href=".\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-rate-cargo-big.jpg" rel="lightbox"  title="Rates per cargo">\r\n						<img alt=".\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-rate-cargo-small.jpg" src=".\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-rate-cargo-small.jpg" style="border-width: 0px; border-style: solid; width: 449px; height: 391px;">\r\n					</a>\r\n				</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n<p>&nbsp;</p>', '', 'php_code'),
