('node', 'body_content', 0, 13, 13, 'und', 0, '<link rel="stylesheet" type="text/css" href="css/demo.css" />\r\n        <link rel="stylesheet" type="text/css" href="css/style_common.css" />\r\n        <!--<link rel="stylesheet" type="text/css" href="css/style10.css" />-->\r\n        <link href=''http://fonts.googleapis.com/css?family=Oswald'' rel=''stylesheet'' type=''text/css'' />\r\n        <link rel="shortcut icon" href="favicon.ico" type="image/x-icon" />\r\n        <script type="text/javascript" src="https://ajax.googleapis.com/ajax/libs/jquery/1.4.4/jquery.min.js"></script>\r\n<script type="text/javascript">\r\n\r\n$(document).ready(function() {\r\n	DrawCaptcha();\r\n  $(''#btnrefresh'').click(function () {\r\n  	DrawCaptcha();\r\n  });\r\n  \r\n  	$(''#submit'').click(function () {\r\n	\r\n		//Get the data from all the fields\r\n		var name = $(''input[name=name]'');\r\n		var email = $(''input[name=email]'');\r\n		var comment = $(''textarea[name=message]'');\r\n		var captcha = $(''input[name=captcha_code]'');\r\n		\r\n			if (name.val()=='''') {alert(''Name field is empty'');return false;}\r\n\r\n			if (comment.val()=='''') {alert(''Message field is empty'');return false;}\r\n				\r\n			if (email.val()=='''') {\r\n					alert(''Email field is empty'');\r\n				return false;\r\n			}\r\n			\r\n			var reg = /^([A-Za-z0-9_\\-\\.])+\\@([A-Za-z0-9_\\-\\.])+\\.([A-Za-z]{2,4})$/;\r\n			var address = email.val();\r\n			\r\n			if(reg.test(address) == false) {\r\n			alert(''Invalid Email Address'');\r\n			return false;\r\n			}\r\n			\r\n			\r\n		if (captcha.val()=='''') {\r\n				alert(''captcha field is empty'');\r\n			return false;\r\n		    } else {\r\n\r\n		var str1 = $(''input[name=txtCaptcha]'');\r\n		var s = str1.val();\r\n		var d = captcha.val();\r\n			if (s != d){\r\n			alert(''invalid captcha'');\r\n			return false;\r\n			}   \r\n		}\r\n\r\n		\r\n		\r\n});\r\n  \r\n	    function DrawCaptcha()\r\n    {\r\n   var chars = "0123456789ABCDEFGHIJKLMNOPQRSTUVWXTZabcdefghiklmnopqrstuvwxyz";\r\n	var string_length = 5;\r\n	var randomstring = '''';\r\n	for (var i=0; i<string_length; i++) {\r\n		var rnum = Math.floor(Math.random() * chars.length);\r\n		randomstring += chars.substring(rnum,rnum+1);\r\n	}\r\n\r\n        var code = randomstring;\r\n        document.getElementById("txtCaptcha").value = code\r\n    }\r\n	\r\n	\r\n	});	\r\n</script>\r\n</head>\r\n\r\n<body>\r\n<div id="header-top"></div>\r\n<div id="header-flash-wrapper-inner">\r\n<!--<div id="header-logo"><a href="#"><img src="images/archipelago-logo.jpg" alt="Archipelago" /></a></div>--></div>\r\n  \r\n <!--CONTENT START-->\r\n  <div id="content-wrapper">\r\n  <div id="con-top-full">\r\n<div class="right-serv"><br/><img src="./sites/all/themes/impact_theme/images/images/archipelago-services-cargo.jpg" style="border-style: none; float: right; alt="" width="322"  height="240"/></div>\r\n          </div>\r\n  <div class="left-serv">\r\n  <p>Is containerized transit too complicated for you?</p>\r\n  <p>We can consolidate your cargo shipments with ease!</p>\r\n  <p>Please contact us at:</p>\r\n  <div class="ad"><p>Marketing Department<br />\r\n  842-9342 loc.37<br />\r\n  0917-855-7529<br />\r\n  inquiries.apfc@fastcat.com.ph</p></div>\r\n </div>\r\n\r\n<div class="middle">\r\n  <!--marketing.apfc@fastcat.com.ph-->\r\n     <form enctype=''multipart/form-data'' action=''sendmail-inq-carg.php'' method=''post'' class="td-form">\r\n\r\n            <table width="335" border="0" cellpadding="0" cellspacing="0">\r\n\r\n              <tr>\r\n\r\n                <td height="45" valign="top" colspan="2"><strong>Name:</strong><br />\r\n\r\n                  <input name="name" type="text" id="name" size="50" /></td>\r\n\r\n              </tr>\r\n               <tr>\r\n\r\n                <td height="45" valign="top" colspan="2"><strong>Address:</strong><br />\r\n\r\n                  <input name="address" type="text" id="address" size="50" /></td>\r\n\r\n              </tr>\r\n\r\n           