('node', 'articles', 0, 22, 22, 'und', 0, '<p>kduji ujierfgo isrogerfgo seopf pp rgpi rogwerpteiwg qpw odgoi gp&nbsp;</p><p>ert ierger eroergp erih eprg pokj&nbsp;</p><p>er orotp&nbsp;</p><p>erg osrjg orogore erowq4t- &nbsp;iirowet weorpowu.</p>', '', 'filtered_html'),
('node', 'articles', 0, 25, 25, 'und', 0, '<p>Every minute of every day, somewhere among and between the 7,100 islands of the Philippines, a boat is sailing, a ship is navigating, a Ro-Ro (roll on-roll off) is transporting cargo and passengers, and seafarers are going about their merry business out there in the sea.<br><br>This is how Christopher S. Pastrana, chair of the board of the Archipelago Philippine Ferries Corp. (APFC), aptly describes the importance of the Philippine maritime corridor, used by about 45 million people a year as a means to transport passengers, goods and services. And it is this reality and magnitude in numbers that inspired Pastrana and his team to fully commit to the upliftment of the maritime industry.... <span><a href="http://business.inquirer.net/127309/out-to-sea-safely-fastly-conveniently" title="">[read more...]</a></span></p>', '', 'full_html'),
('node', 'body_content', 0, 27, 27, 'und', 0, '<p><img alt="" src="\\fastcat.com.ph\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-about-4.jpg" style="width: 199px; height: 134px;"></p>', '', 'full_html'),
('node', 'articles', 0, 28, 28, 'und', 0, '<p><a href="\\fastcat.com.ph\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-summer-outing-b.jpg" rel="lightbox" style="color: rgb(1, 150, 227); outline: none; font-family: Arial, Helvetica, sans-serif; line-height: normal;"><img class="news-padding" src="\\fastcat.com.ph\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-summer-outing.jpg" style="padding-right: 15px; padding-bottom: 35px; border-style: none; float: left;" title="Click to enlarge"></a></p><div>&nbsp;</div>', '', 'php_code'),
('node', 'articles', 0, 29, 29, 'und', 0, '<p><a href="http://www.youtube.com/watch?v=dxjbfTOZpOw&amp;feature=player_embedded" style="color: rgb(1, 150, 227); outline: none; line-height: normal;" title=""><img alt="" src="\\fastcat.com.ph\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-gma-news.jpg" style="width: 293px; height: 184px;"></a></p>', '', 'full_html'),
('node', 'articles', 0, 30, 30, 'und', 0, '<p><span style="color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px;">CITY OF CALAPAN—Travel time between this city and Batangas will soon be an hour shorter, on board a brand new and modern roll-on-roll-off (Ro-Ro) vessel.</span><br style="margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px;"><br style="margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px;"><span style="color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px;">The new vessel, called a “FastCat Ferry” operated by the Filipino-owned Archipelago Philippine Ferries Corp. (APFC), will take only about an hour and a half to cross Calapan from Batangas and vice versa, down from the usual 2.5-hour travel time with existing Ro-Ro vessels plying the same sea route...&nbsp;</span><span style="color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; line-height: 15px;"><a href="http://newsinfo.inquirer.net/415707/new-fast-craft-to-shorten-travel-to-calapan" style="color: rgb(1, 150, 227); outline: none;" title="">[read more...]</a></span></p>', '', 'filtered_html'),
('node', 'articles', 0, 31, 31, 'und', 0, '<p><a href="http://www.youtube.com/watch?v=h2gFW1JPtXc&amp;feature=youtu.be" style="color: rgb(1, 150, 227); outline: none; font-family: Arial, Helvetica, sans-serif; line-height: normal;" title=""><img align="left" class="news-padding" src="\\fastcat.com.ph\\sites\\all\\themes\\impact_theme\\images\\images\\archipelago-video-sof-launch.jpg" style="padding-right: 15px; padding-bottom: 35px; border-style: none;"></a></p>', '', 'full_html'),
('node', 'articles', 0, 32, 32, 'und', 0, '<p style="margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px; font-family: Arial, Helvetica, sans-serif; line-height: 15px; color: rgb(51, 51, 51);"><strong>City of Calapan</strong>&nbsp;- A brand new vessel will operate in Mindoro Island within the years FASTCAT Ferry of the Archipelago Philippine Ferries Corporation (APFC) will ply Batangas to Calapan., Oriental Mindoro (and vice versa) in 1.5 hrs. said officials. It had its soft launch on April 29, during the 58th birthday of Oriental Mindoro Governor, Alfonso Umali Jr., at the city''s seaport.</p><p style="margin-top: 0px; margin-bottom: 0px; padding-bottom: 15px; font-family: Arial, Helvetica, sans-serif; line-height: 15px; color: rgb(51, 51, 51);"><strong>Major ports</strong><br style="margin: 0px; padding: 0px;"><br style="margin: 0px; padding: 0px;">"We choose the ports of Batangas and Mindoro because they are the biggest when it comes to traffic volume, connecting vessels...&nbsp;<a href="\\fastcat.com.ph\\sites\\all\\themes\\impact_theme\\images\\images\\axrchipelago-soft-launch-b.jpg" rel="lightbox" style="color: rgb(1, 150, 227); outline: none;" title="">[read more...]</a></p>', '', 'filtered_html'),
('node', 'articles', 0, 33, 33, 'und', 0, '<p><a href="\\fastcat.com.ph\\sites\\all\\themes\\impact_theme\\images\\images\\axrchipelago-news-photo-vessels-b.jpg" rel="lightbox" style="color: rgb(1, 150, 227); outline: none; font-family: Arial, Helvetica, sans-serif; line-height: normal;" title=""><img align="left" class="news-padding" src="\\fastcat.com.ph\\sites\\all\\themes\\impact_theme\\images\\images\\axrchipelago-news-photo-vessels.jpg" style="padding-right: 15px; padding-bottom: 35px; border-style: none;" title="Click to enlarge"></a></p>', '', 'full_html'),
('node', 'articles', 0, 34, 34, 'und', 0, '<p><a href="\\fastcat.com.ph\\sites\\all\\themes\\impact_theme\\images\\images\\Now Ready.jpg" rel="lightbox" style="color: rgb(1, 150, 227); outline: none; font-family: Arial, Helvetica, sans-serif; line-height: normal;"><img class="news-padding" src="\\fastcat.com.ph\\sites\\all\\themes\\impact_theme\\images\\images\\Now Ready.jpg" style="padding-right: 15px; padding-bottom: 35px; border-style: none; float: left; width: 250px; height: 180px;" title="Click to enlarge"></a></p><h1 class="h1-news" style="margin-top: 0px; margin-bottom: 15px; font-family: FuturaStdMedium; font-size: 15px; color: rgb(51, 51, 51); text-transform: uppercase; line-height: normal;">&nbsp;</h1>', '', 'full_html');
