(3, 'node', ' frequently asked questions faq s  1 ticketing bookings a where can we purchase tickets tickets may be purchased at the booth of fastcat located at the port terminals b is ticket reservation necessary reservation is not necessary as tickets are available for purchase at the fast cat ticket booths c do you give discounts on fares fastcat is pleased to offer the following fare discounts infants below 2 years of age free children from ages 211 years old 50 discount s tudents and senior citizens 20 discount a valid id will be required to avail of the discounts d if the trip was cancelled are tickets refundable in an unfortunate case that a trip was cancelled due to unavailability of the vessel the ticket will not be refunded in cash however our port personnel shall assist you to be transferred to another vessel for your convenience in cases where trips are cancelled due to nonconducive weather conditions tickets will be applied on the next available trip after the ban to sail is lifted by the philippine coast guard authorities e do you have a facility for online bookings unfortunately as of now we do not have an online facility for both passenger and cargo bookings however you may send inquiries at archipelago philippine ferries corp unit 5b 5th floor unioil center bldg commerce ave cor acacia ave madrigal business park alabang muntinlupa city tel no 632 842 9341 to 42 fax no 632 8075670 email address inquiryapfc fastcatcomph f what documents do i need to present if i will board my vehicle on the vessel one must present the following documents to the port authorities 1 original official receipt of the vehicle 2 original certificate of registration of the vehicle 3 two valid id s a driver s license b a valid id with photo 2 restrictions prohibitions  a what items are not allowed inside the vessel for the security and safety of the sea faring public the following are prohibited inside the vessel free roaming uncaged animals any deadly weapon or firearm explosive devices chemicals corrosive substances hand carried flammable substances b is there a smoking area we regret to inform you that within the airconditioned area of the business class and premium economy smoking is strictly prohibited however there is a designated smoking area at the sundeck economy section 3 others a is food available for sale at the vessel yes food may be purchased at our onboard cafetería b how early shall i be for my trip passengers are expected to have bought their tickets at least an hour before the trip schedule and should be at the boarding area at least 30 minutes before departure time c we would like to advertise through your vessels how much will they cost and who do we contact please contact our marketing department for your advertising needs  marketing department 8429342 loc 37 9178557529 marketingapfc fastcatcomph d how do we go about offering food products to be sold at your vessels for inquiries please contact  human resources department tel no 8429342 loc 24 hradminapfc fastcatcomph e what is the maximum weight for a handcarry luggage the maximum weight allowed for a handcarry luggage per person is 15 kilograms any excess to that shall be left at your vehicle otherwise you may ask for assistance from our area representatives for proper storage instructions     ', 0),
(5, 'node', ' job opportunities our company is looking for candidates for the following positions  three 3 vessel inspectors 1batangas 1calapan 1lipata  qualifications female male at least twentyone 21 years of age a college graduate of any four 4 year bachelors degree preferably with one 1 year work experience one 1 liason officer office staff head office alabang muntinlupa city  qualifications preferably male at least twentyone 21 years of age a college graduate of any four 4 year bachelor s degree preferably with relevant work experience one 1 accounting assistant to be assigned at clark pampanga  qualifications female at least twentyone 21 years of age must be a certified public accountant cpa at least 12 years of work experience in an accounting function three 3 tellers pursers to be assigned in batangas and in calapan mindoro  qualifications female male at least twentyone 21 years of age must be a college graduate of any four 4 year bachelor s degree preferably with one 1 year work experience within the field of finance accounting  1 cashier calapan mindoro  qualifications female male at least twentyone 21 years of age must be a college graduate of any four 4 year bachelor s degree preferably with one 1 year work experience within the field of finance accounting  1 terminal assistant secretary head office alabang muntinlupa city  qualifications preferably female at least twentyone 21 years of age must be a college graduate of any four 4 year bachelor s degree preferably with clerical and administrative experience in an office environment usher usherette canteen steward batangas and calapan mindoro  qualifications male with a minimum of 55 in height female with a minimum of 53 in height at least twentyone 21 years of age must be a college graduate of any four 4 year bachelor s degree preferably in hotel restaurant management or a course that promotes tourism customer service excellence fresh graduates are also welcome to apply  2 finance managers archipelago capp group alabang muntinlupa city  qualifications male female with a mature outlook must possess a degree in bachelor of science in accountancy preferably with a postgraduate degree in accountancy and is a certified public accountant cpa at least 5 years of work experience is required  ', 0),
(6, 'node', ' fastcat f1  windowjquery documentwrite var j jquerynoconflict j document ready function examples images j a example1 fancybox j a example2 fancybox overlayshow false transitionin elastic transitionout elastic j a example3 fancybox transitionin none transitionout none j a example4 fancybox opacity true overlayshow false transitionin elastic transitionout none j a example5 fancybox j a example6 fancybox titleposition outside overlaycolor  overlayopacity 9 j a example7 fancybox titleposition inside j a example8 fancybox titleposition over j a rel examplegroup fancybox transitionin none transitionout none titleposition over titleformat function title currentarray currentindex currentopts return image currentindex 1 currentarraylength titlelength title examples various j various1 fancybox titleposition inside transitionin none transitionout none j various2 fancybox j various3 fancybox width 75 height 75 autoscale false transitionin none transitionout none type iframe j various4 fancybox padding  autoscale false transitionin none transitionout none document ready function contenu scrollbar  sections of the vessel cardeck   can hold up to 3034 cars and 67 trucks buses roll on roll off ramp safety life rafts in case of emergency elevator for people with disabilities business class   fully air conditioned with an lcd tv and can accommodate up to 63 passengers all with individual life vests premium economy  fully air conditioned with 2 lcd tv s and can accommodate up to 107 passengers all with individual life vests sundeck economy  open area and can accommodate up to 105 passengers all with individual life vests  cafeteria  with a wide selection of food and beverages engine room   equipped with superior engines that are fully compliant with international maritime standards the bridge   with stateoftheart navigation and control system   unique and safety features of fastcat fastcat was designed by sea transport solution of australia the leading designer of midspeed catamaran vessels in the world and operates in more than 30 countries fastcat was specifically designed to suit the weather and sea conditions in the philippines fastcat is certified and classed by the american bureau of shipping abs indicating its compliance with the latest international safety rules and regulations that is why fastcat is safer than other roro vessels a typical roro being used in the philippines has only one hull fastcat on the other hand is a catamaran with two hulls and 10 water tight compartments fastcat s twinhull design makes her more stable because the center of buoyancy and gravity is wider than a monohull fastcat keeps the water out of the vessel that s why it doesn t have a ballast tank unlike the other roro vessels this makes it safer lighter and faster than the rest fastcat can accommodate 275 up to 320 passengers including the disabled and the elderly and has a capacity of approximately 300 lane meters for trucks buses 67 units cars 3034 units and other land vehicles it runs at an average speed of 165 knots therefore is faster than most roro vessels in the philippines it is due to the vessels design and because it is powered by four internationallyclassed and abscertified yanmar engines while most roro vessels only have one fastcat is the first and only proenvironment ferry engine in the philippines having passed the tier 2 emission standards in sulphur and carbon dioxide in short it performs better than most roro engines and emits less pollution in case of an emergency a single engine mono hull roro vessel has to stop the voyage and may not be able to return to the port on the other hand fastcat has four engines and a twin hull therefore it is better equipped to handle engine emergencies than most roro vessels fastcat is also the only ferry compliant to the international maritime organization s safe return to port regulation fastcat has a clearance between the water and the hull of three meters it is three times higher than most roro vessels which are categorized and designed to operate only on inland or smooth water therefore if a onemeter wave hits the vessel water will not get inside the car deck or the hull mitigating the risk of a major maritime incident fastcat is also compliant with international fire safety standards its passenger accommodation area and engine room are insulated with the highest and internationallycertified a60 fire protection system fastcat is also equipped with a complete fire alarm system including the latest fm 200 inside the engine rooms this will ensure the safety of the crew in case of an emergency for the passenger seats fastcat uses eleather a fireretardant durable and environmentfriendly material that is imported from the united kingdom this material is unique because it takes a longer time to combust compared to regular leather or other upholstery materials fastcat uses a stateoftheart navigation and control system it has two steering control systems and in case of failure it can shift from automatic to manual steering inside the engine room and take the passengers safely to shore the vessel has two auxiliary engines that provide electricity but what makes fastcat superior is her bridge control system it is primarily powered by solar panels and wind turbines which makes her proenvironment all these stateoftheart features simply mean that fastcat has a 100 percent redundancy on performance and safety therefore minimizing the risk of maritime incidents also it comes with clean comfort rooms for both men and women as well as the disabled fastcat s design incorporates international environmental and safety standards and she is rated to function and perform for 45 years fastcat is one of the safest and stateoftheart roro vessel but more importantly its crew are competent and ready to be of service to the riding public they undergo regular trainings to keep abreast with the latest technology information and international best practices to ensure the safety of its passengers in all possible scenarios and increase the level of competency and quality of service   fastcat  ', 0),
(7, 'node', ' about us archipelago philippine ferries corporation apfc was founded to provide a vital maritime link between the philippines 7107 islands since its incorporation in 2002 it has become a trusted shipping company that owns and operates the philippines first and only catamaran rollon rolloff roro ferries as well as modernized ports and terminals in the eastern and western philippine sea route in support of the government s strong republic nautical highway project and to facilitate the economical movement of people and goods apfc offers safe fast and convenient ferry service to the islands using stateoftheart roro vessels these new vessels are the first ferries designed specifically for philippine water conditions with its focus on ensuring its passengers safety welfare and comfort apfc embarked on an ambitious refleeting program in 2010 in a bold and unparalleled move it partnered with sea transport solutions of australia the leading designer and builder of midspeed ropax roro vessels built for freight vehicle transport along with passenger accommodations this partnership brings to the philippines for the first time ever 10 brandnew customcrafted cuttingedge ropax vessels fitted with worldclass amenities and fully compliant with international standards for lifesaving fire fighting and damagestability this newferry initiative is in keeping with chairman christopher pastrana s resolve to raise the bar in maritime safety in the philippines and set an example to fellow ropax operators improving not only the ferry industry in general but also enhancing the comfort and convenience of passengers and ensuring their safety in particular the first routes to be served by the new ferries include the town city pairs of batangas city batangas and calapan oriental mindoro roxas oriental mindoro and caticlan aklan matnog sorsogon and allen northern samar bacolod city negros occidental and iloilo city iloilo lilioan southern leyte and lipata surigao del norte and dipolog city zamboanga del norte and dumaguete negros oriental passengers in these routes will experience the safest and fastest sea connections between their chosen town city pairs in addition they will be treated to a wide selection of onboard food and beverages onboard entertainment and comfortable passenger accommodation terminal facilities managed by apfc include those in the ports of matnog sorsogon dapdap allen northern samar san isidro northern samar liloan southern leyte and lipata surigao del norte apfc takes pride in having built strong and lasting ties not only with its partner suppliers and contractors but most importantly with its customers and employees only with their trust help and support has archipelago philippine ferries corporation been able to achieve its status as a trusted provider of consistent and quality service it is apfc s aim to always be deserving of this trust archipelago philippine ferries corporation ferrysafe ferryfast ferryconvenient mission our mission is to make a positive contribution to the economic vitality of the philippines by providing a safe reliable and comfortable ferry transportation system compliant with international standards vision our vision is to set the standard in ferry transportation by providing exceptional performance and customer service core values archipelago philippine ferries corporation is guided at all times by its core values of teamwork integrity commitment and customer focus  ', 0),
