(17, 'node', ' privacy policy privacy notice table of contents  our commitment to privacy the information we collect how we use information our commitment to data security how to access or correct your information our commitment to privacy your privacy is important to us to better protect your privacy we provide this notice explaining our online information practices and the choices you can make about the way your information is collected and used to make this notice easy to find we make it available on our homepage and at every point where personally identifiable information may be requested the information we collect  this notice applies to all information collected or submitted on any of our websites on some pages you can order products make requests and register to receive materials the types of personal information collected at these pages are name address email address phone number credit debit card information etc on some pages you can submit information about other people for example if you order a gift online and want it sent directly to the recipient you will need to submit the recipient s address in this circumstance the types of personal information collected are name address phone number etc  the way we use information  we use the information you provide about yourself when placing an order only to complete that order we do not share this information with outside parties except to the extent necessary to complete that order we use the information you provide about someone else when placing an order only to ship the product and to confirm delivery we do not share this information with outside parties except to the extent necessary to complete that order we use return email addresses to answer the email we receive such addresses are not used for any other purpose and are not shared with outside parties we use nonidentifying and aggregate information to better design our website and to share with advertisers for example we may tell an advertiser that x number of individuals visited a certain area on our website or that y number of men and z number of women filled out our registration form but we would not disclose anything that could be used to identify those individuals finally we never use or share the personally identifiable information provided to us online in ways unrelated to the ones described above without also providing you an opportunity to optout or otherwise prohibit such unrelated uses our commitment to data security to prevent unauthorized access maintain data accuracy and ensure the correct use of information we have put in place appropriate physical electronic and managerial procedures to safeguard and secure the information we collect online how you can access or correct your information you can correct factual errors in your personally identifiable information by sending us a request that credibly shows error to protect your privacy and security we will also take reasonable steps to verify your identity before granting access or making corrections  ', 0),
