(25, 'node', ' out to sea safely fastly conveniently every minute of every day somewhere among and between the 7100 islands of the philippines a boat is sailing a ship is navigating a roro roll onroll off is transporting cargo and passengers and seafarers are going about their merry business out there in the sea this is how christopher s pastrana chair of the board of the archipelago philippine ferries corp apfc aptly describes the importance of the philippine maritime corridor used by about 45 million people a year as a means to transport passengers goods and services and it is this reality and magnitude in numbers that inspired pastrana and his team to fully commit to the upliftment of the maritime industry   read more  ', 0),
